import React, {Component} from 'react'
import { Spin} from 'antd'
/*
头部组件
 */
export default class Loading extends Component{
    render(){
        return(
            <div style={{
                padding:'auto',
                textAlign: 'center',
                position: absolute,
                left: '50%',
                top: '50%',
                transform: 'translate(-50%, -50%)',
            }}>
                <Spin size='large'/>
            </div>
        )
    }
}
